  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA's Undersea Research Center for the
  West Coast and Polar regions operates in the waters offshore of California, Oregon,
  Washington, and Alaska, and the Artic and Antartic. The region is home to economically
  important fisheries as well as active tectonic margins with earthquake producing
  subduction zones and fault zones; cold seeps and gas hydrate deposits; submarine
  canyones; seamounts; and volcanically active mid-ocean ridges. To support research
  of this geologically unique and biologically diverse environment, the WCPR Center
  leases manned submersibles, shallow- and deep-diving ROVs, and other research equipment,
  and funds SCUBA operations.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
